	(252,'2020-12-13 22:02:41','2020-12-13 22:26:47','Christmas Tree Lighting Walk in Shot','video embed',0,'public','1607898382347-Front_WalkShot1.jpg',19,'Christmas-Tree-Lighting-Walk-in-Shot',4821,'<p>&nbsp;This December 10th, The Bethel Production team wanted to do something challenging and intentional for an intro. As 2020 has been plagued with isolating our churches, we didn\'t want just another BTS/On-Air Host welcoming people. &nbsp;So, in the spirit of trying to bring the audience into the experience, we literally took them along for the same walk in experience they would have if they were in person. &nbsp;We thought this was a great challenge and a very intentional way to invite people in. &nbsp;Let us know hour thoughts.&nbsp;</p>','https://www.youtube.com/watch?v=aEW8tjgHuvY','2020-12-09 00:00:00',NULL,NULL),
	(253,'2020-12-13 22:32:41','2020-12-13 22:32:41','Tribe | December 1st 2020','video embed',0,'public','1607898712742-tribe_website-01.jpg',19,'Tribe-w1',4920,'<p>&nbsp;We all know that one thing we need and long for right now is worship. We set aside time to worship the king of kings and want you to join us. Brittany Mondesir, Emmy Rose, and Morgan Faleolo lead us as we look at the face of Jesus and worship Him. &nbsp;</p>','https://www.youtube.com/watch?v=kfiJ6uF_dT0','2020-12-13 22:32:41',NULL,NULL),
