	(259,'2020-12-13 22:52:29','2020-12-18 01:21:41','BTS Tour of our new 2020 Bethel Production Christmas Set!','video embed',1,'public','1607900612067-ChristmasSet_Walkthru.jpg',19,'BTS-Tour-of-our-new-2020-Bethel-Production-Christmas-Set!',4821,'<p>In this video, Drake &amp; Andrew Kelch give an overview of our new worship stage Christmas set design for 2020. Hear how we approached the design, some of the fixtures used and some detailed shots showing the install. &nbsp;&nbsp;Special Thanks to Unilumen, Chauvet, and GLP. &nbsp;For all other details, see our full gear list at www.bethelproduction.com&nbsp;</p>','https://youtu.be/lCriU_9PUJY','2020-12-01 00:00:00',NULL,NULL),
	(260,'2020-12-13 22:53:33','2020-12-13 22:58:26','Learn how Bethel Church Production Team is utilizing Red Komodo 6K\'s In their live broadcasts.','video embed',1,'public','1607900303808-Komodo.png',19,'Learn-how-Bethel-Church-Production-Team-is-utilizing-Red-Komodo-6K\'s-In-their-live-broadcasts.',4821,'<p>&nbsp;In this Video, you hear a segment from our Bethel Production live broadcast multiview production we stream each and every sunday. &nbsp;This segment features Jared Richard, Janna Fenn, and Jaden Willis and how they are currently filming with the Red Komodo 6k cameras and the current rigging setup. &nbsp;&nbsp;&nbsp;Special Thanks to &nbsp;Red Komodo and Vaxis &nbsp;www.red.com www.vaxis.cn &nbsp;&nbsp;If you are wanting to ask questions, be sure to tune into our sunday stream and post your questions for a chance for them to be answered in the broadcast. &nbsp;To get a full list of gear we use, visit www.bethelproduction.com&nbsp;</p>','https://www.youtube.com/watch?v=aNvptafZCI4&t=1s','2020-12-02 00:00:00',NULL,NULL),
