	(263,'2020-12-13 23:31:11','2020-12-13 23:31:11','Bethel Church Online 360 Box Set | Sovereign | Hannah Waters |','video embed',0,'public','1607902269945-bethel-production-black.png',19,'Bethel-Church-Online-360-Box-Set-or-Sovereign-or-Hannah-Waters-or',4920,'<p>&nbsp;This Video shows off our new 360 box set but also shows how our video crew works in this environment! &nbsp;&nbsp;Inspiration behind the set was to not see the worship team play to an empty room and speakers speak to an empty room but to show them united as a team on the stage!&nbsp;</p>','https://www.youtube.com/watch?v=Gv4u7oQaudQ&feature=youtu.be','2020-05-07 00:00:00',NULL,NULL),
	(264,'2020-12-13 23:33:14','2020-12-13 23:33:14','WorshipU After Hours Moment - Multiview','video embed',0,'public','1607902389030-bethel-production-black.png',19,'WorshipU-After-Hours-Moment-Multiview',4821,'<p>&nbsp;This moment is from our 2019 Worship U After Hours set. The evening started at 10pm and went well into 1am. It was a powerful moment for our team having been there serving since 7am. God shows up often when we least expect it. Especially when we\'re tired but come to serve with a willing heart. Let us never forget why we do what we do.&nbsp;</p>','https://www.youtube.com/watch?v=p8yCCvBBP2M&feature=youtu.be','2020-04-21 00:00:00',NULL,NULL),
